description:
This sketchbook shows of the best of artist Steve Epting's work, from Captain America to Star Wars and much more in-between. Epting's astonishing facial artistry is especially highlighted in this collection. Simple but clean, and well-detailed, his efforts are certainly worthy of admiration and celebration. 

This excellent scan is provided by Bchry-DCP. Thanks to them for their efforts, please seed and enjoy!

